import BaseService from "./baseService.js";

class BillingInvoicesService extends BaseService {
  getBillingInvoices(opts = {}) {
    this.endPoint = `/billing-invoices`;
    return this.get(opts);
  }

  updateBillingInvoice(id, payload, opts = {}) {
    this.endPoint = `/update-status-billing-invoices`;
    return this.putOne(id, payload, opts);
  }

  updateBilling(id, payload, opts = {}) {
    this.endPoint = `/billing-invoices`;
    return this.putOne(id, payload, opts);
  }
}

export default new BillingInvoicesService();
